:60381,"version":"2.9.8","buildSourceHash":"2889468034"},"id":10,"dataId":2173074,"css":{}},"length":1,"constructorName":"EffectsCollection","packageData":{"id":0,"name":"BaseCollections","userId":60381,"version":"0.0.1","buildSourceHash":"542005542"},"id":83,"dataId":2173075}},"bd-textblock60":{"constructorName":"TextBlock","packageData":{"id":2890065,"name":"Text","userId":60381,"version":"2.9.2","buildSourceHash":"3446640151"},"textTag":"p","content":"Antigamente quando lancei a primeira versão do módulo, disponibilizei no Github o módulo que aceitava cartão de crédito, e era necessário pedir autorização do PagSeguro para utilizar o checkout transparente. Em seguida, lancei uma versão PRO que acrescentava Boleto e TEF e custava R$9,90/mês.<br>Posteriormente, uma parceria com o PagSeguro foi feita a fim de remunerar o trabalho e ainda oferecer um desconto aos meus usuários. Mesmo assim, ainda mantenho a versão de Assinatura (R$9,90) para usuários que possuem uma taxa menor que 3,29%(30 dias) ou 4,39% (14 dias) junto ao PagSeguro.<br>Além disso, no modelo de aplicação não há suporte à Sandbox, ou seja, transações de teste só podem ocorrer com cartões reais.<br><br><br><b>Eu quero...</b><br><br><br><a href="pro/app.html" draggable="false">Conhecer o modelo de aplicação</a>, onde eu não pago nada a mais e ainda ganho descontos na taxa do PagSeguro.<br><br><br><a href="pro/index.html" draggable="false">Conhecer o modelo de assinatura</a>, pois sou um lojista que possuí um volume muito grande de vendas e tenho taxas espetaculares negociadas com o PagSeguro.<br><br><br><a href="https://www.magentocommerce.com/magento-connect/pagseguro-transparente.html" draggable="false">Fazer download do módulo principal no Magento Connect</a>, e aceitar apenas cartão de crédito, e continuar pagando as taxas que pago hoje ao PagSeguro, afinal eu sei que preciso desse módulo instalado mesmo que depois eu escolha um dos outros dois modelos.<br><br><br>","id":60,"dataId":2173091,"css":{},